            WriteLiteral("r. Təmiz saxlamaq asandır və ağır istifadə üçün kifayət qədər davamlıdırlar.</p>\r\n                        </li>\r\n                    </ul>\r\n                </div>\r\n                <div class=\"where-use-left col-4\">\r\n                    ");
